      out.write("\t\t\t\t\t\t\t<h4 class=\"red09-tit02\">INTERVIEW</h4>\n");
      out.write("\t\t\t\t\t\t\t<p class=\"red09-tit03\">지난 10년은 포메인에서<br>오는 10년은 포메인 레드에서</p>\n");
      out.write("\t\t\t\t\t\t\t<img src=\"../images/red/red9-img.png\" alt=\"\">\n");
      out.write("\t\t\t\t\t\t\t<span class=\"red09-img-span\">포메인 레드 1호점 - 도곡점 김지현 점주</span>\n");
      out.write("\t\t\t\t\t\t\t<div class=\"interview_con\">\n");
      out.write("\t\t\t\t\t\t\t\t<div class=\"icon\">\n");
      out.write("\t\t\t\t\t\t\t\t\t<img src=\"../images/red/red9-icon.png\" alt=\"\" style=\"width:80px;\">\n");
      out.write("\t\t\t\t\t\t\t\t</div>\n");
      out.write("\t\t\t\t\t\t\t\t<ul>\n");
      out.write("\t\t\t\t\t\t\t\t\t<li>\n");
      out.write("\t\t\t\t\t\t\t\t\t\t<img src=\"../images/red/red9-icon1.png\" alt=\"\">\n");
      out.write("\t\t\t\t\t\t\t\t\t\t<b>간략한 자기소개 부탁드립니다.</b>\n");
      out.write("\t\t\t\t\t\t\t\t\t\t<p>포메인을 운영하다 2019년 11월 포메인 레드 1호 도곡점을 오픈한 김지현 점주입니다.</p>\n");
      out.write("\t\t\t\t\t\t\t\t\t</li>\n");
      out.write("\t\t\t\t\t\t\t\t\t<li>\n");
      out.write("\t\t\t\t\t\t\t\t\t\t<img src=\"../images/red/red9-icon1.png\" alt=\"\">\n");
      out.write("\t\t\t\t\t\t\t\t\t\t<b>포메인 양재역점을 운영하다 포메인레드를 창업하게 된 계기는?</b>\n");
      out.write("\t\t\t\t\t\t\t\t\t\t<p>포메인 양재역점을 10년 동안 운영했어요. 그러나 매년 오르는 인건비와 계속 상승하는 임차료로 인한 건물주와의 의견 차이를 좁힐 수 없어 폐업을 결정하게 됐어요. 양재역 사거리 1층이라는 메인상권이 암초로 작용한 것 같아요. 어쩔 수 없는 폐업이었기에 아쉬움이 굉장히 컸는데 마침 그 즈음에 포메인 레드가 런칭했어요. 그동안 찾아주시는 단골분들도 눈에 밟히고 포메인 본사와의 신뢰도 탄탄했기에 포메인 레드 창업을 결정하게 됐어요.</p>\n");
      out.write("\t\t\t\t\t\t\t\t\t</li>\n");
      out.write("\t\t\t\t\t\t\t\t\t<li>\n");
      out.write("\t\t\t\t\t\t\t\t\t\t<img src=\"../images/red/red9-icon1.png\" alt=\"\">\n");
      out.write("\t\t\t\t\t\t\t\t\t\t<b>포메인 레드 경쟁력이 무엇인지?</b>\n");
      out.write("\t\t\t\t\t\t\t\t\t\t<p>메뉴의 맛과 품질은 기본이고, 소규모 매장에 무인결제 시스템 도입으로 인건비 부담 없이 매장을 운영할 수 있다는 점이 큰 경쟁력이라 판단했어요. 최소 인력으로 유연하게 운영할 수 있고 초보자도 어렵지 않게 맛을 낼 수 있어서 전문 주방 인력을 고용하지 않아도 돼 인건비 절약에 일석이조였죠. 포메인 레드는 빠른 회전율과 포장배달을 전문화한 매장이어서 작은 규모지만 규모의 경제가 가능한 브랜드라서 소자본이지만 안정적인 매출을 찾는 예비창업자, 창업 초보자분에게 딱 부합하는 브랜드인 것 같아요. 또 본사와 슈퍼바이저 분들과 10년 동안 쌓아온 신뢰가 한몫했죠. 준비 단계부터 오픈 후에도 내 가게처럼 챙겨주시니까요. 본사 마진이 아니라 ‘함께’ 성장하려는 상생 경영이 참 든든했습니다. 주변에서 본사에서 그렇게까지 신경 써준다고? 하고 놀랄 정도예요.</p>\n");
      out.write("\t\t\t\t\t\t\t\t\t</li>\n");
      out.write("\t\t\t\t\t\t\t\t\t<li>\n");
      out.write("\t\t\t\t\t\t\t\t\t\t<img src=\"../images/red/red9-icon1.png\" alt=\"\">\n");
      out.write("\t\t\t\t\t\t\t\t\t\t<b>매출은 만족하시는지?</b>\n");
      out.write("\t\t\t\t\t\t\t\t\t\t<p>아직 오픈 초기 단계라 매출 실적을 논하기에는 조금 조심스럽지만 일 매출, 월 매출 모두 기대 수익 이상을 달성하고 있어요. 오픈전부터 오픈 날짜를 물어보는 분들이 많았는데, 그게 대박 조짐이었던 거 같아요.(웃음) 포메인 양재역점도 꽤 높은 월매출을 달성했었는데 인건비, 임대료 등 매장운영비를 제하면 순수익률은 포메인 레드가 훨씬 더 좋아요. 실질적으로 포메인 레드가 운영 관리에 신경을 덜 쓸 수 있는 시스템이다 보니 공수는 줄고 매출은 보장되는 더 합리적인 브랜드라는 생각이 들어요.</p>\n");
      out.write("\t\t\t\t\t\t\t\t\t</li>\n");
      out.write("\t\t\t\t\t\t\t\t\t<li>\n");
      out.write("\t\t\t\t\t\t\t\t\t\t<img src=\"../images/red/red9-icon1.png\" alt=\"\">\n");
      out.write("\t\t\t\t\t\t\t\t\t\t<b>예비 창업주들에게 간략한 조언과 앞으로의 포부 부탁드린다.</b>\n");
      out.write("\t\t\t\t\t\t\t\t\t\t<p>안정적인 소자본 창업, 소규모 창업을 고민 중이라면 유행하는 아이템은 지양하고 트렌드를 읽을 줄 아는 눈이 필요해요. 혼밥, 배달, 인건비 절감 등의 키워드를 무시할 수 없더라고요. 또 기본적으로 프랜차이즈를 운영해온 본사 업력과 오픈 후 사후관리, 경영방침 등 면밀한 검토가 필요해요. 지난 10년을 포메인과 함께 해오면서 앞으로의 10년도 포메인 레드와 함께 하기로 결심한 데는 이를 뒷받침하는 본사와의 긴밀한 신뢰가 있어서 가능했어요. 특히 이미 쌀국수 대표 브랜드로 시장의 정상에 자리매김하고도 메뉴 개발과 소통을 게을리하지 않는 모습에 깊은 감명을 받았었거든요. 수년간 연구개발로 성공한 햅쌀면 생산은 묵은쌀로 만든 쌀국수 공산품을 사용하는 타 브랜드와는 비교 불허한, 차원이 다른 경쟁력이 틀림없다고 생각해요. 가맹점 늘리기에만 급급한 여타 프랜차이즈와는 달리 상생의 길을 걸어가고 있는 포메인 레드 본사처럼 당장에 매출이 아니라 맛과 품질 모두 가장 완벽한 쌀국수를 먹을 수 있는 도곡점이 되기 위해 노력하겠습니다.</p>\n");
